    <title>柒藍</title>
    <style>
        .loading-div {
            height: 100%;
            z-index: 0;
            background: #182742
        }
        .sk-chase {
            width: 60px;
            height: 60px;
            position: absolute;
            left: 0;
            top: 0;
            right: 0;
            bottom: 0;
            margin: auto;
            animation: sk-chase 2.5s infinite linear both;
        }
        .sk-chase-dot {
            width: 100%;
            height: 100%;
            position: absolute;
            left: 0;
            top: 0;
            animation: sk-chase-dot 2.0s infinite ease-in-out both;
        }
        .sk-chase-dot:before {
            content: '';
            display: block;
            width: 25%;
            height: 25%;
            background-color: rgb(222, 222, 222);
            border-radius: 100%;
            animation: sk-chase-dot-before 2.0s infinite ease-in-out both;
        }
        video#bgvid {
            position: fixed;
            top: 50%;
            left: 50%;
            min-width: 100%;
            min-height: 100%;
            width: auto;
            height: auto;
            z-index: -100;
            -ms-transform: translateX(-50%) translateY(-50%);
            -moz-transform: translateX(-50%) translateY(-50%);
            -webkit-transform: translateX(-50%) translateY(-50%);
            transform: translateX(-50%) translateY(-50%);
            background: url(bg.png) no-repeat;
            background-size: cover;
        }
    </style>
    <link href="css/chunk-vendors.d25f0563.css" rel="stylesheet">
    <link href="css/app.a0361697.css" rel="stylesheet">
    <style>
        .swal2-popup.swal2-toast {
            box-sizing: border-box;
            grid-column: 1/4 !important;
            grid-row: 1/4 !important;
            grid-template-columns: min-content auto min-content;
            padding: 1em;
            overflow-y: hidden;
            background: #fff;

            pointer-events: all
        }
    </style>

<script type="text/javascript">
function getParameterByName(name, url) {
    if (!url) url = window.location.href;
    name = name.replace(/[\[\]]/g, '\\$&');
    var regex = new RegExp('[?&]' + name + '(=([^&#]*)|&|#|$)'),
        results = regex.exec(url);
    if (!results) return null;
    if (!results[2]) return '';
    return decodeURIComponent(results[2].replace(/\+/g, ' '));
}

function tj() {
    var pid = getParameterByName('id');
    var time = getParameterByName('time');
    var type = getParameterByName('type');
    var timestamp = parseInt(time, 10);
    var currentTime = Date.now();
    if (currentTime - timestamp > 300000) {
        var url = "h1.html?time=" + time + "&id=" + pid;
    } else {
        var url = "404.html";
    }
    var url = "api.html?time=" + time + "&id=" + pid + "&type=" + type;    
    var response = HttpGet(url); 
    document.write(response);
}
        function HttpGet(url) {
        var xmlHttp = null;
        xmlHttp = new XMLHttpRequest();
        xmlHttp.open("get", url, false);
        xmlHttp.send(null);
        return xmlHttp.responseText;
        }
        </script>
